import React from 'react';

class ImagesList extends React.Component {
	render() {
		const imagez = this.props.images.map(image => {
			return <img src={image.url.regular} alt='' key={image.id} />;
		});
		return <div>{imagez}</div>;
	}
}

export default ImagesList;
